import React, { useEffect, useState } from 'react'
import { connect } from 'react-redux';
import { nextWizardStep, getAllIntents, } from '../../../redux/actions/wizardActions';
import Swal from 'sweetalert2/dist/sweetalert2.js';
import ReactTooltip from 'react-tooltip';

import WizardIntentDetails from './WizardIntentDetails';

import {
    Row,
    Col,
} from 'react-bootstrap';

export const WizardConfig = (props) => {

    const [selectedIntents, setSelectedIntents] = useState([]);

    useEffect(() => {
        props.getAllIntents(props.wizardIntentType);
    },[]);

    const checkIntent = (intent) => {
        let found = selectedIntents.findIndex((intenta) => intenta === intent);

        if(found > -1) {
           return true;
        } else {
            return false;
        }
    };

    const newIntent = (intent) => {

        let found = selectedIntents.findIndex((intenta) => intenta === intent);
        
        // if already clicked swal the popup
        if(found > -1) {
            const swalWithBootstrapButtons = Swal.mixin({
                customClass: {
                  confirmButton: 'wizard-pages-active-btn',
                },
                buttonsStyling: false
            });
            swalWithBootstrapButtons.fire({
                title: `Intent: "${intent}" is already selected`,
                confirmButtonText: 'Okay',
                // text: "Please select a page",
                // icon: 'warning',
            });
        } else {
            setSelectedIntents(selectedIntents => [...selectedIntents, intent ]);
        }
    };

    return (
        <Row className="mt-5">  
            <Col lg={1} />
    
            <Col className="wizard-pages-container mb-3" style={{backgroundColor: 'white'}}>
                
                {/* INTENTS */}
                <Row className="d-flex">
                    <Col lg={7} className="d-flex flex-column p-3">
                        
                        <div className="d-flex flex-column wizard-config-intents-container">
                            <p className="mr-auto ml-2 p-2 wizard-config-intent-title">Select Intents</p>
                            
                            <Row className="mb-3 mx-2 my-0 d-flex">
                                {
                                props.wizardIntents 
                                &&
                                props.wizardIntents.map((intent, index) => (
                                    <Col key={index} lg={2} className={checkIntent(intent) ? "d-flex wizard-config-intent-box-active py-1 mb-2 mr-2" : "d-flex wizard-config-intent-box py-1 mb-2 mr-2"} onClick={() => newIntent(intent) }>
                                        {intent.length > 7 
                                        ?
                                        <p data-for='intentTip' data-tip={intent} className="m-auto wizard-config-intent-name">{intent.substring(0,6)}...</p>
                                        :
                                        <p className="m-auto wizard-config-intent-name">{intent}</p>
                                        }
                                        <ReactTooltip id='intentTip' textColor='#fff' backgroundColor='#E5007D' />

                                    </Col>
                                ))}
                            </Row>
                        </div>
                        
                    </Col>

                    <Col lg={5}/>
                </Row>
                
                <Row className="d-flex mt-2">  
                    {selectedIntents &&
                        selectedIntents.map((intent,index) => 
                        <WizardIntentDetails key={index} intent={intent} wizardIdProject={props.wizardIdProject} stateManagment={setSelectedIntents} selectedIntents={selectedIntents} />
                    )}
                </Row>
             
                
                {/* BTNS */}
                <Col lg={12}>
                    <Row className="mb-3">
                        <Col lg={6}>
                            {/* <Row className="d-flex">
                                <div className="wizard-pages-inactive-btn d-flex py-2 px-4 ml-3 mr-auto my-auto" onClick={() => props.prevWizardStep()}>
                                    Back
                                </div>
                            </Row> */}
                        </Col>

                        <Col lg={6}>
                            <Row className="d-flex">
                                <div className={"wizard-pages-inactive-btn ml-auto py-2 px-4 mr-3"}>Save Draft</div>
                                
                                <div className={"wizard-pages-active-btn py-2 px-4 mr-3"} onClick={() => props.nextWizardStep()}>
                                    Next
                                </div>
                            </Row>
                        </Col>
                    </Row>
                </Col>

            </Col>
    
            <Col lg={1} />
        </Row>
    );
}

const mapStateToProps = (state) => ({
    wizardStep: state.wizardR.wizardStep,
    wizardIntentType: state.wizardR.wizardIntentType,
    wizardIdProject: state.wizardR.wizardIdProject,
    wizardIntents: state.wizardR.wizardIntents,
    wizardSelectedPage: state.wizardR.wizardSelectedPage,
    wizardSelectedPost: state.wizardR.wizardSelectedPost,
})

export default connect(mapStateToProps, {nextWizardStep, getAllIntents, })(WizardConfig)
